import { AppBar, Toolbar, Typography ,Drawer, Button} from "@mui/material";
import { Box } from "@mui/system";
import React, { useState } from "react";
import { useStyles } from "./style";


const Header = (props)=>{

  const s = useStyles()
  let [mode,setMode] = useState(false)

  const changeMode = ()=>{
    setMode(!mode)
  }

  return(
    <AppBar className={s.headerBar}> 
      <Toolbar>
        <Typography className={s.logo} fontSize={25}>neeva</Typography>
        <div className={s.menu}> 
          <Typography className={s.itemMenu}>Sing In</Typography>
          <Typography className={s.itemMenu}>Features</Typography>
          <Typography className={s.itemMenu}>FAQ</Typography>
          <Typography className={s.itemMenu}>Blog</Typography>
          <Typography className={s.itemMenu}>Press</Typography>
          <Typography className={s.itemMenu}>About</Typography>
        </div>
        <div onClick={changeMode}><Button>fsdss</Button></div>
        <Drawer
          open={mode}
          className={s.ret}
        >
          <Box>
            <div><Button onClick={changeMode}>dsds</Button></div>
          </Box>
        </Drawer>
      </Toolbar>
    </AppBar>
  )
}

export default Header;
